import Header from './components/Header';
import {
  BrowserRouter as Router,
  Route,
  Switch,
} from "react-router-dom";



function App() {
  return (
    <>
    <Header/>
    <Router>
      <Switch>
        <Route exact path={'/login'}>
          <Login/>
        </Route>
        <Route exact path={'/home'}>
          <Home/>
        </Route>
    </Switch>
    </Router>
    </>
  )
}

export default App;
